import java.util.List;

class Solution {
    public int numberOfPoints(List<List<Integer>> nums) {
        boolean[] covered = new boolean[101]; // Since endi can be up to 100
        int count = 0;

        for (List<Integer> car : nums) {
            int start = car.get(0);
            int end = car.get(1);
            // Mark all points covered by the current car as true
            for (int i = start; i <= end; i++) {
                covered[i] = true;
            }
        }

        // Count all points that are covered by at least one car
        for (int i = 1; i <= 100; i++) {
            if (covered[i]) {
                count++;
            }
        }

        return count;
    }
}
